import React from 'react'
import {Link} from 'react-bootstrap';

const Menu = () => {
  return (
    <div className = 'menu'>
<ul>
    <li><Link to="/hakkimizda">Hakkimizda</Link></li>    
    <li><Link to="/login">Login</Link></li>
    <li><Link to="/">Anasayfa</Link></li>
</ul>




    </div>
  )
}

export default Menu
